Alabaster is softer and lighter than marble, and it is used in sculpture. Marble, on the other hand, is a metamorphic rock, which means that it was produced from another kind of rock as a result of intense heat and pressure in the Earth‚Äôs crust. Marble is twice as hard as Alabaster in terms of hardness. While Alabaster is a transparent substance, it is not as opaque as other materials.
